	function getRandomVector(vector)
	{
		var max = 0, min = 0;

		    max = vector+10;
            min	= vector-10;
            //if (min<0) {min=0}
            vector = Math.floor(Math.random()*(max-min)+min);
            if (vector <0) {vector = 360 - vector}
            if (vector >360) {vector = vector -360}	
            return vector;	
	}

	function nomerZone(nomer) {
		for (var i = 0; i <kol_zone; i++) {
		x = Math.pow(arrayOfNode[nomer].x-arrayOfstopZone[i].x,2);
		y = Math.pow(arrayOfNode[nomer].y-arrayOfstopZone[i].y,2);
		var distance = Math.sqrt(x+y);
		if (distance<=radiusStopZone) {return i; break}
			// node in stop zone
		}
	}

